A block of memory is defined as a base address and a size, so we need a struct that contains these elements. To wrap the base address pointer, we'll use the recommended type for building collections, std::ptr::NonNull<T> , which is available on stable. pub struct Block { ptr: BlockPtr, size: BlockSize,
} Where BlockPtr and BlockSize are defined as: pub type BlockPtr = NonNull<u8>;
pub type BlockSize = usize; To obtain a Block, we'll create a Block::new() function which, along with Block::drop(), is implemented internally by wrapping the stabilized Rust alloc routines: pub fn new(size: BlockSize) -> Result<Block, BlockError> { // validate that size is a power of two if !(size & (size - 1) == 0) { return Err(BlockError::BadRequest); } Ok(Block { ptr: internal::alloc_block(size)?, size, }) } Where parameter size must be a power of two, which is validated on the first line of the function. Requiring the block size to be a power of two means simple bit arithmetic can be used to find the beginning and end of a block in memory, if the block size is always the same. Errors take one of two forms, an invalid block-size or out-of-memory, both of which may be returned by Block::new(). #[derive(Debug, PartialEq)]
pub enum BlockError { /// Usually means requested block size, and therefore alignment, wasn't a /// power of two BadRequest, /// Insufficient memory, couldn't allocate a block OOM,
